import { Image } from "@chakra-ui/react";

const image = require("images/background-pattern-desktop.svg");

const Desktop = () => {
    return (
      <Image
        src={image}
        alt="Background desktop"
        style={{ width: "100%", height: "100vh" }}
      />
    );
}

export default Desktop;
